SELECT Industry, AVG(ROAS) as Average_ROAS
FROM linkedin_campaigns
GROUP BY Industry;

SELECT Objective, SUM(Conversions) as Total_Conversions
FROM linkedin_campaigns
GROUP BY Objective;

SELECT Device, AVG(Conversion_Rate) AS Avg_Conversion_Rate
FROM linkedin_campaigns
GROUP BY Device;

SELECT DISTINCT Campaign_Name 
FROM linkedin_campaigns 
WHERE Seniority LIKE '%C-Level%';

SELECT Campaign_Name 
FROM linkedin_campaigns 
WHERE CTR > 3;

SELECT Ad_Format, AVG(Engagement_Rate) as Average_Engagement_Rate
FROM linkedin_campaigns
GROUP BY Ad_Format;

SELECT Device, SUM(Clicks) as Total_Clicks
FROM linkedin_campaigns
GROUP BY Device;

SELECT Campaign_Name 
FROM linkedin_campaigns 
WHERE Spend > 30000;
